import {NavigationSlider} from './navigation-slider';

// Slides/Pages
import PageOne from './slides/page-one';

// Create an AwesomeSlider instance with some content
const Slider = () => {
  return (
    <NavigationSlider
      className="awesome-slider"
      animation="foldOutAnimation"
      media={[
        {
          slug: "",
          preload: ["https://www.google.com/url?sa=i&url=https%3A%2F%2Fpicserio.com%2Fview-wallpaper%2F6015079.html&psig=AOvVaw2Vg75x0JLNU1-3ZVHXzCxZ&ust=1589522778709000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPCDzvbXsukCFQAAAAAdAAAAABAH"],
          className: "page-one slide",
          children: <PageOne />
        },
        {
          slug: "page-two",
          className: "page-two slide",
          children: <p>Page Two</p>
        }
      ]}
    />
   )
}

export default Slider;
